// "0x7bE7EFD22Ca998B2C22929b26eB5932A273a28cF", "0xE624122809662bF44D2bDCE71D89Cfb4be6a4F76", 123456
// "0x7bE7EFD22Ca998B2C22929b26eB5932A273a28cF", "0x2Cc8E528796B61Ce0645165d5DA5a4F8f835E722", 456789

// "0x2Cc8E528796B61Ce0645165d5DA5a4F8f835E722", 0

pragma solidity ^0.4.24;

contract Dates {

    address private owner;

	struct Date {
		string id;
		uint256 timestamp;
		address doctor;
		address patient;
	}

	constructor() public {
		owner = msg.sender;
	}

	mapping(address => Date[]) private doctorsDates;
	mapping(address => Date[]) private patientsDates;

	// add a date to Doctor
	function addDate(address doctorAddress, address patientAddress, uint _date) public {  

		// Create new pointer to Date
	    Date[] storage dDates = doctorsDates[doctorAddress];
	    Date[] storage pDates = patientsDates[patientAddress];

		// Create new Date Object
		Date memory newDate;
		newDate.id = uint2hexstr(getUniqueId(patientAddress));
		newDate.timestamp = _date;
		newDate.doctor = doctorAddress;
		newDate.patient = patientAddress;

		// Push the new Date object to patient and doctor
	    dDates.push(newDate);
	    pDates.push(newDate);
	}

	// Get Date object given ID, address and user type
	function getDate(string id, address userAddress, uint _type) public view returns (string) {   
		Date[] memory dates;
		// If Doctor
	    if (_type == 1) {
			dates = doctorsDates[userAddress]; 
		}
	    // Else Patient
	    else { 
			dates = patientsDates[userAddress];
		}

		// Iterate between dates array
		Date memory d;
		for (uint i = 0; i < dates.length; i++) {
		    if (keccak256(abi.encodePacked(dates[i].id)) == keccak256(abi.encodePacked(id))) {
		        d = dates[i];
		        break;
		    }
		}

		string memory res = string(abi.encodePacked('{',
			'"id":"', d.id,
			'","timestamp":"', uint2str(d.timestamp), 
			'","patient":"', addressToString(d.patient),
			'","doctor":"', addressToString(d.doctor),
			'"}'));

		return res;

	}

	function listDatesIds(address _address, uint _type) public view returns (string) {
		Date[] memory dates;

		// If Doctor
	    if (_type == 1) {
			dates = doctorsDates[_address]; 
		}
	    // Else Patient
	    else { 
			dates = patientsDates[_address];
		}

		if (dates.length > 0) {
			string memory datesIds;
			datesIds = dates[0].id;
			for (uint i = 1; i < dates.length; i++) {
				datesIds = string(abi.encodePacked(datesIds, ",", dates[i].id));
			}
			return datesIds;
		} else {
			return "";
		}
	}

	// Generate unique ID
    function getUniqueId(address patientAddress) internal view returns (uint) {
        // hash the msg.sender + patientAddress + date now
        bytes20 b = bytes20(keccak256(abi.encodePacked(msg.sender, patientAddress, now)));  
        uint id = 0;
        for (uint index = b.length-1; index+1 > 0; index--) {
            id += uint(b[index]) * ( 16 ** ((b.length - index - 1) * 2));
        }
        return id;
    }

	// uint to string
    function uint2hexstr(uint i) internal pure returns (string) {
        if (i == 0) return "0";
        uint j = i;
        uint length;
        while (j != 0) {
            length++;
            j = j >> 4;
        }
        uint mask = 15;
        bytes memory bstr = new bytes(length);
        uint k = length - 1;
        while (i != 0){
            uint curr = (i & mask);
            bstr[k--] = curr > 9 ? byte(55 + curr ) : byte(48 + curr); // 55 = 65 - 10
            i = i >> 4;
        }
        return string(bstr);
    }

	// Address to string
    function addressToString(address _addr) internal pure returns(string) {
        bytes32 value = bytes32(uint256(_addr));
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint i = 0; i < 20; i++) {
            str[2+i*2] = alphabet[uint(uint8(value[i + 12] >> 4))];
            str[3+i*2] = alphabet[uint(uint8(value[i + 12] & 0x0f))];
        }
        return string(str);
    }

	function uint2str(uint i) internal pure returns (string){
		if (i == 0) return "0";
		uint j = i;
		uint length;
		while (j != 0){
			length++;
			j /= 10;
		}
		bytes memory bstr = new bytes(length);
		uint k = length - 1;
		while (i != 0){
			bstr[k--] = byte(48 + i % 10);
			i /= 10;
		}
		return string(bstr);
	}
}
